import React from 'react';
import {Route} from "react-router-dom";
import {useNavigate} from "react-router";

//resivira datos por las props
const PrivateRouter = ({isAuthentificate, element: Element, ...rest}) => {
    const navigate = useNavigate();
    return (
        <Route {...rest}
               element = { (props) => (
                   (isAuthentificate) ? <Element {...props} /> : navigate('/login') )} />

    );
};

export default PrivateRouter;
